def jsonloads(data):
    o = []
    while data.find('"uid":')>0:
        n = {}
        fs = data.find('"uid":')+6
        es = data.find(',', fs)
        uid = data[fs:es]
        n['uid'] = uid
        data = data[es:]

        fs = data.find('name":"')+7
        es = data.find('",', fs)
        uid = data[fs:es]
        n['first_name'] = uid.decode('utf-8')
        data = data[es:]

        fs = data.find('name":"')+7
        es = data.find('",', fs)
        uid = data[fs:es]
        n['last_name'] = uid.decode('utf-8')
        data = data[es:]
        
        o.append(n)
    return o
    
def get_base_files():
    directory = 'd:/allid/'; 
    files = os.listdir(directory); 
    line = ''
    for f in files:
        tfile = open(directory+f, "r")
        l = tfile.read()
        tfile.close()
        line += l
    base_names.append(line)
    return line

def get_base():
    get_base_files()
    players = {}
    for b in base_names:
        o = jsonloads(b)
        for p in o:
            name = p['last_name']+" "+p['first_name']
            players[p['uid']] = name
    return players
    
